import React from "react"
import {makeStyles} from "@material-ui/core/styles"
import Table from "@material-ui/core/Table"
import TableBody from "@material-ui/core/TableBody"
import TableCell from "@material-ui/core/TableCell"
import TableContainer from "@material-ui/core/TableContainer"
import TableHead from '@material-ui/core/TableHead'
import TableRow from "@material-ui/core/TableRow"
import Paper from "@material-ui/core/Paper"
import {AppRootStateType} from "../api/store";
import {useSelector} from "react-redux";
import {BrowserRouter, HashRouter, NavLink, useHistory} from "react-router-dom";

const useStyles = makeStyles({
    table: {
        minWidth: 650,
    },
})

export const TableDeals: React.FC = () => {
    const classes = useStyles()

    const history = useHistory()

    const {deals} = useSelector((state: AppRootStateType) => state.deals)

    const getCurrentDeal = (id: string) => {
        return BX24.callMethod(
            "crm.deal.get",
            {id: id},
            function (result) {
                if (result.error())
                    console.error(result.error());
                else
                    console.dir(result.data());
            }
        );
    }

    return (
        <TableContainer component={Paper}>
            <Table className={classes.table} aria-label="simple table">
                <TableHead>
                    <TableRow>
                        <TableCell>ID</TableCell>
                        <TableCell align="right">Наименование</TableCell>
                        <TableCell align="right">Стадия сделки</TableCell>
                        <TableCell align="right">Сумма</TableCell>
                        <TableCell align="right">Клиент</TableCell>
                    </TableRow>
                </TableHead>
                <TableBody>
                    {deals.map((deal) => (
                        <TableRow key={deal.ID}>
                            <TableCell component="th" scope="row">
                                <button onClick={() => history.push(`crm/deal/details/${deal.ID}`)}>{deal.ID}</button>
                            </TableCell>
                            <TableCell align="right">{deal.TITLE}</TableCell>
                            <TableCell align="right">{deal.STAGE_ID}</TableCell>
                            <TableCell align="right">{deal.OPPORTUNITY}</TableCell>
                            <TableCell align="right">{deal.ORIGIN_ID}</TableCell>
                        </TableRow>
                    ))}
                </TableBody>
            </Table>
        </TableContainer>
    )
}
